import React from 'react';
import './aboutPage.css';

const AboutPage = () => {
  return (
    <div className='aboutPage'>
      <div className='aboutPage-top'></div>
      <div className='aboutPage-middle'></div>
      <div className='aboutPage-bottom'></div>
    </div>
  )
}

export default AboutPage
